Custom CSS:
* {
font-weight: normal !important;
}
a > img {
background: white;
padding: 1px;
border: solid 1px #525252;
}
#shortcuts {
opacity: 0;
transition: opacity 0.1s linear 0.1s;
}
#shortcuts:hover {
opacity: 1;
}
#header-bar {
display: none;
}
.post {
padding: 8px;
margin: 0px !important;
border:none !important;
}
.postContainer {
border: solid 1px #525252;
padding: 1px;
margin-bottom: 8px;
background: white;
}
.dateTime {
display: none;
}
.nameBlock {
margin-right: 11px;
}
.fileThumb {
margin: 0px;
margin-top:3px;
margin-right:8px;
}
.postMessage {
margin: 3px !important;
}
.fileText {
opacity: 0;
transition: opacity 0.1s linear 0.1s;
}
.post:hover .fileText {
opacity: 1;
}
